import { rulesBill } from "../../data/Policy";
import { Article } from "../Portal";

const Rules_Overview = () => {
  return (
    <>
      <section className="text-center pagecenter">
        <Article article={rulesBill} icons={false} gap="gap-y-5" />
        <div className="grid grid-cols-4"></div>
      </section>
    </>
  );
};

export default Rules_Overview;
